  \"The GlideSonde: A Lifting Body Guided Dropsonde Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 7,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T03:30:03.861038\",\n\t\"name\": \"the-glidesonde-a-lifting-body-guided-dropsonde-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"tDropsondes are one of the primary in-situ
  measurement tools available to research aircraft and Unmanned Aerial Vehicles (UAVs).
  \ Unlike sensors mounted on aircraft, dropsondes allow a vertical profile of the
  atmosphere to be taken below the aircraft.  A guided dropsonde which could glide
  away from the launch aircraft will allow profiles to be taken away from the aircraft
  flight path, and would offer aircraft the ability to deploy dropsondes into dangerous
  environments, such as thunderstorms and volcanic plumes, where few aircraft are
  able to safely venture.rntAnasphere, Inc., in cooperation with Vanilla Aircraft,
  Inc., proposes to develop a guided dropsonde to meet this need.  This dropsonde
  will be designed as a lifting body.  It will build upon an existing miniature dropsonde
  developed by Anasphere, have essentially no moving parts, retain the ability to
  return wind profiles along with accurate meteorological data, and have sufficient
  speed to penetrate moderate headwinds.  rntPhase I work will include designing and
  prototyping the aerodynamic form, integrating essential guidance electronics, and
  conducting extensive glide tests.  Phase II work will include the integration of
  complete sensor, guidance, and communications payloads, refinement of the aerodynamic
  form, and extensive live flight tests from high altitude.\",\n\t\"license_title\":
